import wea from "../src/images/ty1.png";


   const Alertc = () => {
  return (
    <>
        <div className='container'>
        <figure>
            <img src={wea} alt="contactAlertImg"/>
          </figure>
          <button className='btn-donate'>Go Back</button>
        </div>
    </>
  )
}

export default Alertc
